import * as React from 'react';
import { Card, CardMedia, CardContent, CardActionArea, CardHeader, Typography, Link } from '@material-ui/core';
import { projectData } from '../data/data';


const Projects = (props) => {
  return (
    <div className='projects' >
      <h1>Some of my recent Projects</h1>
      <div className='projects-container'>
        {projectData.map((data, key) => {
          return (
            <CardActionArea>
              <Card className='project-card' key={key}>
                <CardHeader title={data.name} />
                <CardMedia component="img" image={data.image} alt='project' />
                <CardContent>
                  <Typography variant='body1' component='p'>{data.description}</Typography>
                </CardContent>
                <a className='project-link' href={data.link}/>
              </Card>
            </CardActionArea>
          );
        })}
      </div>
    </div>
  );
}
export default Projects;
